html:
{%- macro add_header(page_num, max_pages, doc, letter_head, no_letterhead, footer, print_settings=None) -%} {% if letter_head and not no_letterhead %}
<div class="letter-head">{{ letter_head }}</div>
{% endif %} {%- endmacro -%}

<div id="header-html" class="hidden-pdf">
	{{ add_header(0,1,doc,letter_head, no_letterhead) }}
</div>


<div>
	<div id="footer-html" class="hidden-pdf">
		{% if not no_letterhead and footer %}
		<div class="letter-head-footer">
			{{ footer }}
		</div>
		{% endif %}
			<p class="text-center small page-number">
				{{ _("Page {0} of {1}").format('<span class="page"></span>', '<span class="topage"></span>') }}
			</p>
	</div>
	<div class="row">
		<div class="col-xs-12">
			{{ doc.rendered_contract_template }}
		</div>
	</div>
</div>
